// Loop over input items and extract meeting ID from the URL
for (const item of $input.all()) {
 const url = item.json.output.meeting_notes;

 // Find the position of "::" and "?"
 const startIndex = url.indexOf("::") + 2;
 const endIndex = url.indexOf("?");

 // Extract the meeting ID
 const meetingId = url.substring(startIndex, endIndex);

 // Replace the entire item with only the meeting ID
 item.json = { meetingId: meetingId };
}

return $input.all();

const items = $input.all();

return items.map(item => {
  const rawText = item.json.content.parts[0].text;

  const parsed = JSON.parse(rawText);

  return {
    json: parsed,
  };
});
